      <param name="A_14" value="id='_Init()' algoritmo='sí' expresión='x' hacer='detener=0;nparticulas=1;partsdesc=0;;_InitPts2();_InitPtsX()' tipo='función' ">

      <param name="A_16" value="id='_InitPtsX()' algoritmo='sí' expresión='x' inicio='initPtsX=0' hacer='_InitPtsY();;initPtsX=initPtsX+1' mientras='initPtsX<L' tipo='función' ">

      <param name="G_04" value="espacio='E1' tipo='texto' fondo='no' color='000000' dibujar-si='Expl==0' coord_abs='sí' expresión='[542,85]' texto='En esta sección, puedes generar un cúmulo de partículas mediante agregación limitada por difusión.\n\nSi pulsas “Comenzar”, verás en \color{ff0000}{rojo} los puntos donde se genera una nueva partícula dentro de un anillo determinado.\n\nElla se difundirá como ya previamente has visto, y podrá, por un lado, pegarse a las partículas centrales del cúmulo, o bien, escapar y ser descartada.\n\nEl proceso de difusión no se muestra nuevamente en esta sección debido aque ralentizaría mucho el proceso.' decimales='2' fijo='sí' ancho='442' negrita='no' cursiva='no' font_family='SansSerif' fuente puntos='19' align='a_justify' anchor='a_top_left' border_size='0' shadowColor='false' shadowBlur='0' shadowOffsetX='0' shadowOffsetY='0' ">
      <param name="G_05" value="espacio='E1' tipo='texto' fondo='no' color='000000' dibujar-si='Expl==1' coord_abs='sí' expresión='[542,85]' texto='También puedes pulsar “Generar sin animar”, con lo cual podrás sólo ver el cúmulo final, saltándo así la muestra de puntos donde se originaron las partículas.\n\nUna vez generado el cúmulo completo, con el número de partículas indicadas por el pulsador “Núm. de partículas”, podrás calcular los extremos de un polígono que flanquea justamente tu cúmulo y calcularle la dimensión fractal mediante la fórmula:\n\c{\serif{\b{\${D_H = \frac{ln(N)}{ln(\sqrt{}{(∆x)(∆y)})}}}}}' decimales='2' fijo='sí' ancho='442' negrita='no' cursiva='no' font_family='SansSerif' fuente puntos='19' align='a_justify' anchor='a_top_left' border_size='0' shadowColor='false' shadowBlur='0' shadowOffsetX='0' shadowOffsetY='0' ">
      <param name="G_06" value="espacio='E1' tipo='texto' fondo='no' color='000000' dibujar-si='Expl==2' coord_abs='sí' expresión='[542,85]' texto='Recuerda que \serif{\b{\${N}}} se refiere al número de partículas en la caja de tu elección, \serif{\b{\${∆x}}} se refiere a la anchura de tu caja elegida y \serif{\b{\${∆y}}} a la altura.\n\nAunque la caja original contemplada es aquella que abarca justamente al cúmulo, prueba modificarla para contener sólo partes del cúmulo, procurando no hacerla muy pequeña. Una vez selecciónada, puedes calcular la dimensión fractal nuevamente.\n\nRecuerda, además, que la caja de tu elección ha de contener partículas dentro.' decimales='2' fijo='sí' ancho='442' negrita='no' cursiva='no' font_family='SansSerif' fuente puntos='19' align='a_justify' anchor='a_top_left' border_size='0' shadowColor='false' shadowBlur='0' shadowOffsetX='0' shadowOffsetY='0' ">
      <param name="G_07" value="espacio='E1' tipo='texto' fondo='no' color='000000' dibujar-si='Expl==3' coord_abs='sí' expresión='[542,85]' texto='¿Te parece familiar la figura que has obtenido?\n\nEn efecto, es similar a las agregaciones de los 3 primeros videos de la motivación de la unidad.\n\nLo curioso es que estos 3 fenómenos no tienen mucho en común. Pulsa el botón “Más información” para leer más al respecto.' decimales='2' fijo='sí' ancho='442' negrita='no' cursiva='no' font_family='SansSerif' fuente puntos='19' align='a_justify' anchor='a_top_left' border_size='0' shadowColor='false' shadowBlur='0' shadowOffsetX='0' shadowOffsetY='0' ">
      <param name="G_08" value="espacio='E2' tipo='punto' fondo='no' color='20303a' coord_abs='no' expresión='(Pts2[s,0],Pts2[s,1])' familia='s' s.intervalo='[0,npartis]' s.pasos='npartis' decimales='2' fijo='sí' tamaño='2' negrita='no' cursiva='no' font_family='SansSerif' fuente puntos='18' ">
      <param name="G_09" value="espacio='E2' tipo='punto' fondo='no' color='ff303a' dibujar-si='(GtMtrx==0)&(nparticulas>1)&(nparticulas!=nparts+1)' coord_abs='no' expresión='(x,y)' decimales='2' fijo='sí' tamaño='2' negrita='no' cursiva='no' font_family='SansSerif' fuente puntos='18' ">
      <param name="G_10" value="espacio='E2' tipo='arco' fondo='no' color='20303a' dibujar-si='(GtMtrx==0)&(nparticulas>1)&(nparticulas!=nparts+1)' coord_abs='no' centro='(L/2,L/2)' radio='radiomin' inicio='0' fin='360' vectores='no' decimales='2' fijo='sí' ancho='1' negrita='no' cursiva='no' font_family='SansSerif' fuente puntos='18' lineDash='solid' ">
      <param name="G_11" value="espacio='E2' tipo='arco' fondo='no' color='20303a' dibujar-si='(GtMtrx==0)&(nparticulas>1)&(nparticulas!=nparts+1)' coord_abs='no' centro='(L/2,L/2)' radio='radiomax' inicio='0' fin='360' vectores='no' decimales='2' fijo='sí' ancho='1' negrita='no' cursiva='no' font_family='SansSerif' fuente puntos='18' lineDash='solid' ">
      <param name="G_12" value="espacio='E2' tipo='polígono' fondo='no' color='e1853a' dibujar-si='boxon==1' coord_abs='no' expresión='(lft,dn)(lft,up)(rgt,up)(rgt,dn)(lft,dn)' ancho='1' lineDash='solid' ">
      <param name="G_13" value="espacio='E2' tipo='texto' fondo='no' color='000000' dibujar-si='boxon' coord_abs='sí' expresión='[10,10]' texto='Partículas totales = \serif{\b{\${[nparticulas-1]}}}    \serif{\b{\${∆x = [rgt-lft]}}}    \serif{\b{\${∆y = [up-dn]}}}\nPartículas en la caja = \serif{\b{\${[((GtMtrx==1)|(GtMtrx==2))?counts:((GtMtrx==3)?counts+1:counts-1)]}}}\nDimensión fractal = \serif{\b{\${[dimfract]}}}' decimales='2' fijo='no' ancho='1' color_borde_texto='ffffff' negrita='no' cursiva='no' font_family='SansSerif' fuente puntos='19' align='a_left' anchor='a_top_left' border_size='0' shadowColor='false' shadowBlur='0' shadowOffsetX='0' shadowOffsetY='0' ">
      <param name="G_14" value="espacio='E3' tipo='texto' fondo='no' color='2c3e50' coord_abs='sí' expresión='(E3._w/2,E3._h-22)' texto='[cueststp] / 4' decimales='2' fijo='no' ancho='1' negrita='sí' cursiva='no' font_family='SansSerif' fuente puntos='18' align='a_left' anchor='a_center_center' border_size='0' shadowColor='false' shadowBlur='0' shadowOffsetX='0' shadowOffsetY='0' ">
      <param name="G_15" value="espacio='E3' tipo='rectángulo' fondo='sí' color='273c75' coord_abs='sí' expresión='(1,1,E3._w-3,E3._h-3)' ancho='3' border_radius='0' lineDash='solid' ">
      <param name="G_16" value="espacio='E3' tipo='rectángulo' fondo='sí' color='20303a' coord_abs='sí' expresión='(0,0,E3._w,35)' relleno='273c75' ancho='0' border_radius='0' lineDash='solid' ">
      <param name="G_17" value="espacio='E3' tipo='texto' fondo='no' color='000000' coord_abs='sí' expresión='(20,50)' texto='Cuestionario' decimales='2' fijo='sí' ancho='E3._w-40' negrita='sí' cursiva='no' font_family='SansSerif' fuente puntos='19' align='a_justify' anchor='a_top_left' border_size='0' shadowColor='false' shadowBlur='0' shadowOffsetX='0' shadowOffsetY='0' ">
      <param name="G_18" value="espacio='E3' tipo='texto' fondo='no' color='000000' dibujar-si='cueststp==1' coord_abs='sí' expresión='[20,100]' texto='En el Cierre podrás ver una descripción general de los fenómenos de Electrodeposición, formación de colonias bacterianas y ruptura dieléctrica, observados.\n\nTenemos, pues, 3 fenómenos distintos en su naturaleza, pero que presentan una similitud visual con los cúmulos generados en esta sección.\n\nResulta que los cúmulos observados en la Motivación comparten una dimensión fractal muy cercana a \serif{\b{\${1.7}}}. El resultado obtenido en los cúmulos que tú has generado no dista mucho de la de ellos (la diferencia principal debida a que en este modelo se implementa la simplificación de considerar que las partículas están restringidas a una red, y no pueden moverse con total libertad).' decimales='2' fijo='sí' ancho='E3._w-40' negrita='no' cursiva='no' font_family='SansSerif' fuente puntos='19' align='a_justify' anchor='a_top_left' border_size='0' shadowColor='false' shadowBlur='0' shadowOffsetX='0' shadowOffsetY='0' ">
      <param name="G_19" value="espacio='E3' tipo='texto' fondo='no' color='000000' dibujar-si='cueststp==2' coord_abs='sí' expresión='[20,100]' texto='No obstante la diferencia, nota cómo cada cúmulo generado en nuestra simulación, a pesar de ser distinto a cualquier otro generado igual, comparte una muy semejante dimensión fractal. Y también lo hacen los subconjuntos del mismo como notaste al tomar cajas que no abarcaran el cúmulo total.\n\nAhora te recomiendo intentes responder unas preguntas para reafirmar lo aprendido.' decimales='2' fijo='sí' ancho='E3._w-40' negrita='no' cursiva='no' font_family='SansSerif' fuente puntos='19' align='a_justify' anchor='a_top_left' border_size='0' shadowColor='false' shadowBlur='0' shadowOffsetX='0' shadowOffsetY='0' ">
      <param name="G_20" value="espacio='E3' tipo='texto' fondo='no' color='000000' dibujar-si='cueststp==3' coord_abs='sí' expresión='[20,100]' texto='Supón que tomas la dimensión fractal de todo el cúmulo, y luego de partes representativas del todo. ¿Para cuál de los siguientes esperarías obtener un valor similar en ambas pruebas?' decimales='2' fijo='sí' ancho='E3._w-40' negrita='no' cursiva='no' font_family='SansSerif' fuente puntos='19' align='a_justify' anchor='a_top_left' border_size='0' shadowColor='false' shadowBlur='0' shadowOffsetX='0' shadowOffsetY='0' ">
      <param name="G_21" value="espacio='E3' tipo='texto' fondo='no' color='000000' dibujar-si='(cueststp==3)&(TamaMn==1)' coord_abs='sí' expresión='[20,220]' texto='\c{\color{6eb73a}{\b{¡Correcto!}}}\n\nEn un cúmulo muy desarrollado (con muchas partículas), la autosimilitud se hace más evidente. Hacer acercamiento sucesivos sigue resultando en observar un comportamiento similar (claro, hasta el punto en que el acercamiento resulte en observar ya las partículas individuales, sean éstas átomos, bacterias, etc.).' decimales='2' fijo='sí' ancho='E3._w-40' negrita='no' cursiva='no' font_family='SansSerif' fuente puntos='19' align='a_justify' anchor='a_top_left' border_size='0' shadowColor='false' shadowBlur='0' shadowOffsetX='0' shadowOffsetY='0' ">
      <param name="G_22" value="espacio='E3' tipo='texto' fondo='no' color='000000' dibujar-si='(cueststp==3)&(TamaMn==2)' coord_abs='sí' expresión='[20,220]' texto='\c{\color{db2c3a}{\b{Incorrecto.}}}\n\nA diferencia de un fractal diseñado como los estudiados en la primera unidad de fractales, en un fractal de un sistema natural hay un límite al realizar acercamientos sucesivos. En algún momento llegarás a la escala de átomos (caso de la electrodeposición) o a la escala de células (caso de las bacterias).\n\nPara observar un comportamiento fractal necesitas muchas partículas (para alejarte de la escala atómica o celular en que se pierde ese comportamiento).' decimales='2' fijo='sí' ancho='E3._w-40' negrita='no' cursiva='no' font_family='SansSerif' fuente puntos='19' align='a_justify' anchor='a_top_left' border_size='0' shadowColor='false' shadowBlur='0' shadowOffsetX='0' shadowOffsetY='0' ">
      <param name="G_23" value="espacio='E3' tipo='texto' fondo='no' color='000000' dibujar-si='cueststp==4' coord_abs='sí' expresión='[20,100]' texto='Para objetos que crecen en dos dimensiones, y que abarcan parcialmente el área sobre la que crecen, la fórmula para estimar su dimensión fractal está dada por \serif{\b{\${D_H = \frac{ln(N)}{ln(\sqrt{}{(∆x)(∆y)})}}}}. Bajo el razonamiento usado para producir dicha fórmula, trata de obtener una fórmula para cúmulos que se encuentran en 3 dimensiones.\n\nUsa tu fórmula para calcular la dimensión fractal de un objeto que abarca \serif{\b{\${N = 40000}}} celdas de una caja con \serif{\b{\${∆x = 30}}}, \serif{\b{\${∆y = 40}}} y \serif{\b{\${∆z = 50}}}.' decimales='2' fijo='sí' ancho='E3._w-40' negrita='no' cursiva='no' font_family='SansSerif' fuente puntos='19' align='a_justify' anchor='a_top_left' border_size='0' shadowColor='false' shadowBlur='0' shadowOffsetX='0' shadowOffsetY='0' ">
      <param name="G_24" value="espacio='RetroForm' tipo='rectángulo' fondo='sí' color='273c75' coord_abs='sí' expresión='(1,1,RetroForm._w-3,RetroForm._h-3)' ancho='3' border_radius='0' lineDash='solid' ">
      <param name="G_25" value="espacio='RetroForm' tipo='texto' fondo='no' color='000000' dibujar-si='FormCorr==1' coord_abs='sí' expresión='[20,20]' texto='\color{20b33a}{\b{¡Correcto!}}\n\nLa fórmula a considerar en este caso es el promedio geométrico en 3 dimensiones. Esto es, \serif{\b{\${D_H = \frac{ln(N)}{ln(\sqrt{3}{(∆x)(∆y)(∆z)})}}}}.\nAplicando los valores en dicha fórmula, el resultado es el que obtuviste.' decimales='2' fijo='sí' ancho='RetroForm._w-40' negrita='no' cursiva='no' font_family='SansSerif' fuente puntos='19' align='a_justify' anchor='a_top_left' border_size='0' shadowColor='false' shadowBlur='0' shadowOffsetX='0' shadowOffsetY='0' ">
      <param name="G_26" value="espacio='RetroForm' tipo='texto' fondo='no' color='cc243a' dibujar-si='FormCorr==2' coord_abs='sí' expresión='[20,20]' texto='Incorrecto' decimales='2' fijo='sí' ancho='1' negrita='sí' cursiva='no' font_family='SansSerif' fuente puntos='19' align='a_left' anchor='a_top_left' border_size='0' shadowColor='false' shadowBlur='0' shadowOffsetX='0' shadowOffsetY='0' ">
      <param name="G_27" value="espacio='RetroForm' tipo='texto' fondo='no' color='000000' dibujar-si='(FormCorr==2)&(!ShwAnsFormCorr)' coord_abs='sí' expresión='[20,60]' texto='\b{Sugerencia:} el cúmulo ahora comienza a abarcar volumen. Por tanto, ahora se deben considerar longitudes en 3 ejes en vez de en sólo 2 (como antes \serif{\b{\${∆x}}} y \serif{\b{\${∆y}}}). Esto es, la parte de la fórmula que corresponde al promedio geométrico ha de re-escribirse.' decimales='2' fijo='sí' ancho='RetroForm._w-40' negrita='no' cursiva='no' font_family='SansSerif' fuente puntos='19' align='a_justify' anchor='a_top_left' border_size='0' shadowColor='false' shadowBlur='0' shadowOffsetX='0' shadowOffsetY='0' ">
      <param name="G_28" value="espacio='RetroForm' tipo='texto' fondo='no' color='000000' dibujar-si='(FormCorr==2)&(ShwAnsFormCorr)' coord_abs='sí' expresión='[20,60]' texto='El promedio geométrico ahora está dado por \serif{\b{\${\sqrt{3}{(∆x)(∆y)(∆y)}}}}, por lo que la fórmula ahora está dada por \serif{\b{\${D_H = \frac{ln(N)}{ln(\sqrt{3}{(∆x)(∆y)(∆z)}}}}}. Usando los valores del problema en dicha fórmula, obtendrás un valor alrededor de \serif{\b{\${[(3*log(40000))/(log(60000))]}}}.' decimales='2' fijo='sí' ancho='RetroForm._w-40' negrita='no' cursiva='no' font_family='SansSerif' fuente puntos='19' align='a_justify' anchor='a_top_left' border_size='0' shadowColor='false' shadowBlur='0' shadowOffsetX='0' shadowOffsetY='0' ">
      <param name="G_29" value="espacio='Info' tipo='rectángulo' fondo='sí' color='273c75' coord_abs='sí' expresión='(1,1,Info._w-3,Info._h-3)' ancho='3' border_radius='0' lineDash='solid' ">
      <param name="G_30" value="espacio='Info' tipo='rectángulo' fondo='sí' color='20303a' coord_abs='sí' expresión='(0,0,Info._w,35)' relleno='273c75' ancho='0' border_radius='0' lineDash='solid' ">
      <param name="G_31" value="espacio='Info' tipo='texto' fondo='no' color='000000' coord_abs='sí' expresión='[20,50]' texto='\color{ff0000}{\b{¡IMPORTANTE!}}\n\nAunque la presente sección puede correr en JavaScript y, por tanto, ser vista en dispositivos portátiles, se sugiere sea vista en una computadora. Ello se debe a la magnitud de los cálculos involucrados para generar los cúmulos, ya que el explorador se puede detener por un tiempo considerable al presionar botones como “Generar sin animar”, “Calcular extremos” y, en caso de tener cúmulos grandes previamente, el botón “Reiniciar”. En estos casos, es posible que el explorador del dispositivo portátil no muestre respuesta, o pida detener el script.\n\nDebido a la magnitud de cálculos necesarios para generar cúmulos de gran tamaño, misma que ralentiza el proceso, el límite de partículas a generar en esta sección se ha restringido a \serif{\b{\${750}}} como máximo. Nota que, aún así, puede tomar algo de tiempo generar cúmulos de \serif{\b{\${750}}} y, si usas la opción “Generar sin animar”, tu explorador puede tomar un tiempo en generar dicho cúmulo.\n\nNo obstante, se incluyen 3 distintos ejemplos, previamente generados, de \serif{\b{\${7500}}} partículas, y que no tardan en cargar. Dichos se pueden accesar mediante el menú que indica “Ejemplos disponibles” en la parte inferior de la sección. Dicho menú estará disponible cuando no haya un cúmulo presente (es decir, al principio de la sección o tras reiniciar). El pulsador a la derecha del panel izquierdo te permitirá modificar la escala para poder hacer acercamientos a diversas partes del cúmulo una vez éste haya sido generado.' decimales='2' fijo='sí' ancho='Info._w-40' negrita='no' cursiva='no' font_family='SansSerif' fuente puntos='19' align='a_left' anchor='a_top_left' border_size='0' shadowColor='false' shadowBlur='0' shadowOffsetX='0' shadowOffsetY='0' ">
      <param name="Animación" value="pausa='1' controles='no' auto='no' repetir='no' inicio='E2.escala=1;E2.Ox=-300*E2.escala;E2.Oy=300*E2.escala;npartis=nparts;x=0;y=0;dmin=1;nparticulas=1;mitad=ent(L/2);iPts2=0;Pts[mitad,mitad]=1;partsdesc=0' hacer='bla=generapart();bla=difunde(x,y);' mientras='(nparticulas<=nparts)&(detener==0)' ">
